import { Outlet } from "react-router-dom";
import { NavBar } from "../Components/NavBar";


function Home() {

    return (
        <div>
            <NavBar />
            <Outlet />
            <footer>
                <div class="container">
                    <p>&copy; 2024 Megalodon Web. Todos los derechos reservados.</p>
                </div>
            </footer>
        </div>
    )
}

export default Home;
